create table quiz_guest
(
    id             int auto_increment
        primary key,
    template_id    int         null,
    guest_nickname varchar(50) null,
    pin_num        int         null,
    count          int         null,
    total_count    int         null,
    score          int         null,
    quiz_room_id   int         null,
    host_id        binary(16)  null
);

